import React, { useEffect, useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import TabelaCars from '../components/tabelaCars'; // Make sure the path is correct
import '../App.css';

function Admin() {
  // ... (your existing code)

  return (
    <main>
      <div className="container" style={{ textAlign: 'center' }}>
        {/* ... (your existing code) */}
        <div className="row">
          <h2 className="text-uppercase" style={{ paddingTop: '25px', paddingBottom: '10px' }}>
            Filtriraj podatke :
          </h2>
          <div className="col-6 md" style={{ paddingTop: '5px' }}>
            <select
              className="form-control"
              name="type"
              value={filterName}
              onChange={handleFilterNameChange}
            >
              {/* ... (your existing code) */}
            </select>
          </div>
          <div className="col-6 md" style={{ paddingTop: '5px' }}>
            <select
              className="form-control"
              name="type"
              value={filterType}
              onChange={handleFilterTypeChange}
            >
              {/* ... (your existing code) */}
            </select>
          </div>
        </div>

        <TabelaCars
  cars={cars}
  carsFiltered={carsFiltered}
  onEdit={handleEdit}
  onDelete={handleDelete}
  handleFilterNameChange={handleFilterNameChange}
  handleFilterTypeChange={handleFilterTypeChange}
/>

        {/* ... (your existing code) */}
      </div>
      {/* ... (your existing code) */}
    </main>
  );
}

export default Admin;
